// Header.js
import { FaBell, FaSearch, FaUserCircle } from 'react-icons/fa';

const Header = () => {
  return (
    <header className="bg-white shadow-md p-4 flex items-center justify-between">
      {/* Branding/Logo */}
      <div className="text-2xl font-bold text-gray-700">Admin Panel</div>

      {/* Search Bar */}
      <div className="hidden md:flex items-center bg-gray-100 rounded-full px-4 py-2 w-1/2">
        <FaSearch className="text-gray-500 mr-2" />
        <input
          type="text"
          placeholder="Search..."
          className="bg-transparent focus:outline-none w-full"
        />
      </div>

      {/* User and Notifications */}
      <div className="flex items-center space-x-4">
        <FaBell className="text-gray-600 text-2xl cursor-pointer hover:text-gray-900" />
        <div className="relative">
          <FaUserCircle className="text-gray-600 text-3xl cursor-pointer hover:text-gray-900" />
          <div className="absolute right-0 mt-2 w-48 bg-white border rounded shadow-md p-2 hidden">
            <a href="#" className="block px-4 py-2 text-gray-700 hover:bg-gray-100">Profile</a>
            <a href="#" className="block px-4 py-2 text-gray-700 hover:bg-gray-100">Settings</a>
            <a href="#" className="block px-4 py-2 text-gray-700 hover:bg-gray-100">Logout</a>
          </div>
        </div>
      </div>
    </header>
  );
};

export default Header;
